    <ButtonGroup aria-label="Basic example">
    
    <Button variant="primary" size="lg">All News</Button>
      <Button variant="light"  size="lg">Clubs</Button>
      <Button variant="light" size="lg">U-Village</Button>
      <Button variant="light" size="lg">Education</Button>
      
    </ButtonGroup>
    
    </>
  )
}

export default Categ
